import React from 'react';
//import logo from './logo.svg';
import './App.css';
import { Route, Router } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Router>
        <switch>
          <Route path='/'>HI</Route>
        </switch>
      </Router>
    </div>
  );
}

export default App;
